    private static $replace_codes_1 = ["<3 ", ":o) ", ":* ", ":-* ", "</3 ", "=) ", "=-) ", "C: ", "c: ", ":D ", ":-D ", ":> ", ":-> ", ";) ", ";-) ", "8) ", ":| ", ":-| ", ":\ ", ":-\ ", ":/ ", ":-/ ", ":p ", ":-p ", ":P ", ":-P ", ":b ", ":-b ", ";p ", ";-p ", ";b ", ";-b ", ";P ", ";-P ", "): ", ":( ", ":-( ", ">:( ", ">:-( ", ":'( ", "D: ", ":o ", ":-o ", ":O ", ":-O ", ":) ", "(: ", ":-) "];

    private static $replace_codes_2 = [":heart: ", ":monkey_face: ", ":kiss: ", ":kiss: ", ":broken_heart: ", ":smiley: ", ":smiley: ", ":smile: ", ":smile: ", ":smile: ", ":smile: ", ":laughing: ", ":laughing: ", ":wink: ", ":wink: ", ":sunglasses: ", ":neutral_face: ", ":neutral_face: ", ":confused: ", ":confused: ", ":confused: ", ":confused: ", ":stuck_out_tongue: ", ":stuck_out_tongue: ", ":stuck_out_tongue: ", ":stuck_out_tongue: ", ":stuck_out_tongue: ", ":stuck_out_tongue: ", ":stuck_out_tongue_winking_eye: ", ":stuck_out_tongue_winking_eye: ", ":stuck_out_tongue_winking_eye: ", ":stuck_out_tongue_winking_eye: ", ":stuck_out_tongue_winking_eye: ", ":stuck_out_tongue_winking_eye: ", ":disappointed: ", ":disappointed: ", ":disappointed: ", ":angry: ", ":angry: ", ":cry: ", ":anguished: ", ":open_mouth: ", ":open_mouth: ", ":open_mouth: ", ":open_mouth: ", ":slightly_smiling_face: ", ":slightly_smiling_face: ", ":slightly_smiling_face: "];

    /***
     * @var bool
     */
    private $inline_styles;

    /**
     * IISEMOJI_CLASS_BackendRender constructor.
     * @param bool $inline_styles
     */
    public function __construct($inline_styles = false)
    {
        $this->inline_styles = $inline_styles;
    }

    /**
     * @param $key
     * @return string
     */
    private function generate_emoji_html($key)
    {
        $m = 2.5;
        $code = self::$codes[$key];
        $bg_pos = ($code[0]*$m).'% '.($code[1]*$m).'%';
        $emoji_utf8 = $code[2];
        $blank_img_src = OW::getPluginManager()->getPlugin('base')->getStaticUrl() . 'css/images/1px.png';
        if ($this->inline_styles){
            $bg_path = IISEMOJI_CLASS_EventHandler::getInstance()->getEmojiFilePath();
            return "<img alt='$emoji_utf8' src='$blank_img_src' style='background: url($bg_path);background-size:4100%;background-position:$bg_pos;display: inline-block;width: 22px;height: 22px;margin-top: -2px;vertical-align: middle;' />";
        }else{
            return "<img class='emj' alt='$emoji_utf8' src='$blank_img_src' style='background-position:$bg_pos;' />";
        }
    }

    /***
     * @param $matches
     * @return string
     */
    private function replace_callback($matches)
    {
        $key = $matches[2];

        if ( (!isset(self::$codes[$key])) && (strpos($key, ':') === 0 && isset(self::$codes[substr($key, 1, strlen($key)-2)])) ){
            $key = substr($key, 1, strlen($key)-2);
        }

        if(isset(self::$codes[$key])){
            $html = $this->generate_emoji_html($key);
            return $matches[1].$html.$matches[4];
        }

        return $matches[0];
    }

    /***
     * @param $clear_string
     * @return mixed
     */
    public function render($clear_string)
    {
        $callback = array($this, 'replace_callback');

        // Replace special emojies like <3
        $clear_string = str_replace(self::$replace_codes_1, self::$replace_codes_2, $clear_string);

        // Match Emoticons
        $regex = '/()(([\x{1F600}-\x{1F64F}]))()/u';
        $clear_string = preg_replace_callback($regex, $callback, $clear_string);

        // Match Miscellaneous Symbols and Pictographs
        $regex = '/()(([\x{1F300}-\x{1F5FF}]))()/u';
        $clear_string = preg_replace_callback($regex, $callback, $clear_string);

        // Match Transport And Map Symbols
        $regex = '/()(([\x{1F680}-\x{1F6FF}]))()/u';
        $clear_string = preg_replace_callback($regex, $callback, $clear_string);

        // Match Miscellaneous Symbols
        $regex = '/()(([\x{2600}-\x{26FF}]))()/u';
        $clear_string = preg_replace_callback($regex, $callback, $clear_string);

        // Match Dingbats
        $regex = '/()(([\x{2700}-\x{27BF}]))()/u';
        $clear_string = preg_replace_callback($regex, $callback, $clear_string);

        // Match emojies starting with :
        $regex = '/( |^|\n|\t|>)(\:(\w|\)|\(|\-|\\\\|\/|\'|\*|\|)+)( |$|\n|\t|<)/u';
        $clear_string = preg_replace_callback($regex, $callback, $clear_string);

        // Match emojies that start and end with :
        $regex = '/()(\:(\w|-)+\:)()/u';
        $clear_string = preg_replace_callback($regex, $callback, $clear_string);

        return $clear_string;
    }

    /***
     * @param $clear_string
     * @return string
     */
    public static function replace_utf8($clear_string)
    {
        $clear_string = str_replace(array_keys(self::$utf8_to_text), array_values(self::$utf8_to_text), $clear_string);
        return $clear_string;
    }
}